import{_ as o,c as t,I as s,a as l,aR as e,o as i,D as r}from"./chunks/framework.DF2lHuXC.js";const f=JSON.parse('{"title":"前端需要的免费在线api接口","description":"","frontmatter":{},"headers":[],"relativePath":"note/front-end/node/03-前端需要的免费在线api接口.md","filePath":"note/front-end/node/03-前端需要的免费在线api接口.md","lastUpdated":1720707843000}'),p={name:"note/front-end/node/03-前端需要的免费在线api接口.md"},d=e('<h1 id="前端需要的免费在线api接口" tabindex="-1">前端需要的免费在线api接口 <a class="header-anchor" href="#前端需要的免费在线api接口" aria-label="Permalink to &quot;前端需要的免费在线api接口&quot;">​</a></h1><p>整理了几个 <strong>免费的在线api接口</strong>，而且不需要处理跨域等问题。</p><p>希望能给刚入门的前端小白在学习 <code>Ajax</code> 时提供一点帮助。</p><p>本文列举的在线接口包括：<strong>文本</strong> 和 <strong>图片</strong>。</p><p>本文案例都是使用 <code>postman</code> 进行测试的，因为我懒得自己写 <code>Ajax</code> 代码。</p>',5),n=e('<h2 id="一、-json-placeholder" tabindex="-1">一、{JSON} Placeholder <a class="header-anchor" href="#一、-json-placeholder" aria-label="Permalink to &quot;一、{JSON} Placeholder&quot;">​</a></h2><p><strong><a href="http://jsonplaceholder.typicode.com/" target="_blank" rel="noreferrer">『JSONPlaceholder』</a> 提供用于测试的免费API。</strong></p><p><code>JSONPlaceholder</code> 使用方式非常简单，提供了 <code>GET</code>、<code>POST</code>、<code>PUT</code>、<code>PATCH</code>、<code>DELETE</code> 几个请求方法。</p><p>还提供分页查询、具体id查询等功能。</p><h4 id="例-获取100篇文章数据-get" tabindex="-1">例：获取100篇文章数据（GET） <a class="header-anchor" href="#例-获取100篇文章数据-get" aria-label="Permalink to &quot;例：获取100篇文章数据（GET）&quot;">​</a></h4><p>返回100条数据，每条内容都有帖子 ID、发贴人 ID、标题、以及简介。</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>http://jsonplaceholder.typicode.com/posts</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h4 id="例-根据文章id获取文章数据-get" tabindex="-1">例：根据文章ID获取文章数据（GET） <a class="header-anchor" href="#例-根据文章id获取文章数据-get" aria-label="Permalink to &quot;例：根据文章ID获取文章数据（GET）&quot;">​</a></h4><p>根据文章 <code>ID</code> 获取指定文章的数据。</p><p>返回：文章 ID、发贴人 ID、标题、以及内容。</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>http://jsonplaceholder.typicode.com/posts/2</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>本例传入的 ID 为2，返回 ID 为2的数据。</p><h4 id="例-添加文章-post" tabindex="-1">例：添加文章（POST） <a class="header-anchor" href="#例-添加文章-post" aria-label="Permalink to &quot;例：添加文章（POST）&quot;">​</a></h4><p>使用 <code>POST</code> 发送一篇文章，发送成功会返回一个文章 ID 回来。</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>http://jsonplaceholder.typicode.com/posts</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h4 id="其他接口-自己试试吧" tabindex="-1">其他接口（自己试试吧） <a class="header-anchor" href="#其他接口-自己试试吧" aria-label="Permalink to &quot;其他接口（自己试试吧）&quot;">​</a></h4><h5 id="帖子接口" tabindex="-1">帖子接口： <a class="header-anchor" href="#帖子接口" aria-label="Permalink to &quot;帖子接口：&quot;">​</a></h5><ul><li>获取帖子列表：<a href="http://jsonplaceholder.typicode.com/posts" title="http://jsonplaceholder.typicode.com/posts" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/posts</a></li><li>根据帖子ID获取详情：<a href="https://jsonplaceholder.typicode.com/posts/1" title="https://jsonplaceholder.typicode.com/posts/1" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/posts/1</a></li><li>获取某个用户所有的帖子：<a href="http://jsonplaceholder.typicode.com/posts%3FuserId%3D5" title="http://jsonplaceholder.typicode.com/posts?userId=5" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/posts?userI…</a></li><li>获取帖子所有的评论：<a href="https://jsonplaceholder.typicode.com/posts/1/comments" title="https://jsonplaceholder.typicode.com/posts/1/comments" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/posts/1/com…</a></li></ul><h5 id="评论接口" tabindex="-1">评论接口 <a class="header-anchor" href="#评论接口" aria-label="Permalink to &quot;评论接口&quot;">​</a></h5><ul><li>获取评论列表：<a href="http://jsonplaceholder.typicode.com/comments" title="http://jsonplaceholder.typicode.com/comments" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/comments</a></li><li>获取某个帖子的所有评论：<a href="http://jsonplaceholder.typicode.com/comments%3FpostId%3D4" title="http://jsonplaceholder.typicode.com/comments?postId=4" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/comments?po…</a></li></ul><h5 id="专辑接口" tabindex="-1">专辑接口： <a class="header-anchor" href="#专辑接口" aria-label="Permalink to &quot;专辑接口：&quot;">​</a></h5><ul><li>获取专辑列表：<a href="http://jsonplaceholder.typicode.com/albums" title="http://jsonplaceholder.typicode.com/albums" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/albums</a></li><li>根据专辑ID获取详情：<a href="http://jsonplaceholder.typicode.com/albums/6" title="http://jsonplaceholder.typicode.com/albums/6" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/albums/6</a></li><li>获取某个用户所有专辑：<a href="http://jsonplaceholder.typicode.com/albums%3FuserId%3D9" title="http://jsonplaceholder.typicode.com/albums?userId=9" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/albums?user…</a></li></ul><h5 id="待办事宜接口" tabindex="-1">待办事宜接口： <a class="header-anchor" href="#待办事宜接口" aria-label="Permalink to &quot;待办事宜接口：&quot;">​</a></h5><ul><li>获取待办事宜列表：<a href="http://jsonplaceholder.typicode.com/todos" title="http://jsonplaceholder.typicode.com/todos" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/todos</a></li><li>根据待办ID获取详情：<a href="http://jsonplaceholder.typicode.com/todos/6" title="http://jsonplaceholder.typicode.com/todos/6" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/todos/6</a></li><li>获取某个用户所有待办事宜：<a href="http://jsonplaceholder.typicode.com/todos%3FuserId%3D9" title="http://jsonplaceholder.typicode.com/todos?userId=9" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/todos?userI…</a></li></ul><h5 id="用户接口" tabindex="-1">用户接口： <a class="header-anchor" href="#用户接口" aria-label="Permalink to &quot;用户接口：&quot;">​</a></h5><ul><li>获取用户列表：<a href="http://jsonplaceholder.typicode.com/users" title="http://jsonplaceholder.typicode.com/users" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/users</a></li><li>根据用户ID获取详情：<a href="http://jsonplaceholder.typicode.com/users/5" title="http://jsonplaceholder.typicode.com/users/5" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/users/5</a></li></ul><h5 id="照片接口" tabindex="-1">照片接口： <a class="header-anchor" href="#照片接口" aria-label="Permalink to &quot;照片接口：&quot;">​</a></h5><ul><li>获取照片列表：<a href="http://jsonplaceholder.typicode.com/photos" title="http://jsonplaceholder.typicode.com/photos" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/photos</a></li><li>根据照片ID获取详情：<a href="http://jsonplaceholder.typicode.com/photos/8" title="http://jsonplaceholder.typicode.com/photos/8" target="_blank" rel="noreferrer">jsonplaceholder.typicode.com/photos/8</a></li></ul><h2 id="二、猫奴福利接口" tabindex="-1">二、猫奴福利接口 <a class="header-anchor" href="#二、猫奴福利接口" aria-label="Permalink to &quot;二、猫奴福利接口&quot;">​</a></h2><p><strong><a href="https://thecatapi.com/" title="https://thecatapi.com/" target="_blank" rel="noreferrer">『The Cat API - Cats as a Service.』</a> 会返回猫的图片，绝对是福利。</strong></p><p>使用方法可以看 <a href="https://docs.thecatapi.com/" title="https://docs.thecatapi.com/" target="_blank" rel="noreferrer">『文档』</a> ，里面包括猫的 “按品种搜索”、“按类别搜索”、“分页搜索”、“图片上传”、“图像分析”等接口，可以对照文档使用。</p><h4 id="例-随机获取1张猫图-get" tabindex="-1">例：随机获取1张猫图（GET） <a class="header-anchor" href="#例-随机获取1张猫图-get" aria-label="Permalink to &quot;例：随机获取1张猫图（GET）&quot;">​</a></h4><p>每次请求都会随机返回一张猫的图片。</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>https://api.thecatapi.com/v1/images/search?limit=1</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>其他接口的使用都比较简单，<a href="https://docs.thecatapi.com/" title="https://docs.thecatapi.com/" target="_blank" rel="noreferrer">『官方文档』</a> 都讲得很明白的，可以自己用 <code>postman</code> 测一下。</p><h2 id="三、狗子接口" tabindex="-1">三、狗子接口 <a class="header-anchor" href="#三、狗子接口" aria-label="Permalink to &quot;三、狗子接口&quot;">​</a></h2><p><a href="https://dog.ceo/dog-api/" title="https://dog.ceo/dog-api/" target="_blank" rel="noreferrer">『Dog API』</a> 提供了狗子的图片，官网的首页第一眼看到的 <code>api</code> 就可以随机获得一张狗子照片，非常有趣。</p><h4 id="例-随机返回一张狗子照片-get" tabindex="-1">例：随机返回一张狗子照片（GET） <a class="header-anchor" href="#例-随机返回一张狗子照片-get" aria-label="Permalink to &quot;例：随机返回一张狗子照片（GET）&quot;">​</a></h4><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>https://dog.ceo/api/breeds/image/random</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>其他接口的用法也好简单，详情可看 <a href="https://dog.ceo/dog-api/documentation/" title="https://dog.ceo/dog-api/documentation/" target="_blank" rel="noreferrer">『狗子官方文档』</a></p><h2 id="四、随机图片接口" tabindex="-1">四、随机图片接口 <a class="header-anchor" href="#四、随机图片接口" aria-label="Permalink to &quot;四、随机图片接口&quot;">​</a></h2><p><a href="https://picsum.photos/" title="https://picsum.photos/" target="_blank" rel="noreferrer">『Lorem Picsum』</a> 可以随机返回一张照片，还可以指定照片的尺寸。</p><p><code>Lorem Picsum</code> 提供的接口返回的是一个图片资源，而且是随机返回的。</p><p>可以直接放在 <code>&lt;img&gt;</code> 标签的 <code>src</code> 属性内使用。</p><h4 id="例-返回-宽和高都是200px-的图片-get" tabindex="-1">例：返回 <code>宽和高都是200px</code> 的图片（GET） <a class="header-anchor" href="#例-返回-宽和高都是200px-的图片-get" aria-label="Permalink to &quot;例：返回 `宽和高都是200px` 的图片（GET）&quot;">​</a></h4><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>https://picsum.photos/200</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h4 id="例-比如想要获取-宽200-高300-的图片-get" tabindex="-1">例：比如想要获取 <code>宽200，高300</code> 的图片（GET） <a class="header-anchor" href="#例-比如想要获取-宽200-高300-的图片-get" aria-label="Permalink to &quot;例：比如想要获取 `宽200，高300` 的图片（GET）&quot;">​</a></h4><p>如果宽高尺寸不同，可以自己设置。</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>https://picsum.photos/200/300</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h2 id="五、其他接口" tabindex="-1">五、其他接口 <a class="header-anchor" href="#五、其他接口" aria-label="Permalink to &quot;五、其他接口&quot;">​</a></h2><p>前面4个是我用得最多的测试平台，接下来这些是我用得比较少，但知道有这回事。有需要的话可以自己测测。</p><h4 id="爱奇艺接口" tabindex="-1">爱奇艺接口 <a class="header-anchor" href="#爱奇艺接口" aria-label="Permalink to &quot;爱奇艺接口&quot;">​</a></h4><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>https://cache.video.iqiyi.com/jp/avlist/{片源id}/{页码}/</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h5 id="例-用海贼王的片源id-get" tabindex="-1">例：用海贼王的片源id（GET） <a class="header-anchor" href="#例-用海贼王的片源id-get" aria-label="Permalink to &quot;例：用海贼王的片源id（GET）&quot;">​</a></h5><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>https://cache.video.iqiyi.com/jp/avlist/202861101/1/</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>可以猜到：</p><ul><li><code>vpic</code>：每集的封面</li><li><code>shortTitle</code>：集数</li><li><code>vt</code>：本集的名称</li><li><code>vid</code>：视频id</li><li><code>vur</code>：视频播放地址</li></ul><p>其他字段自己猜吧，我懒~</p><h4 id="物流接口" tabindex="-1">物流接口 <a class="header-anchor" href="#物流接口" aria-label="Permalink to &quot;物流接口&quot;">​</a></h4><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>http://www.kuaidi100.com/query?type=快递公司代号&amp;postid=快递单号</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p><strong>快递公司编码：</strong></p><ul><li><p>申通：<code>shentong</code></p></li><li><p>EMS：<code>ems</code></p></li><li><p>顺丰：<code>shunfeng</code></p></li><li><p>圆通：<code>yuantong</code></p></li><li><p>中通：<code>zhongtong</code></p></li><li><p>韵达：<code>yunda</code></p></li><li><p>天天：<code>tiantian</code></p></li><li><p>汇通：<code>huitongkuaidi</code></p></li><li><p>全峰：<code>quanfengkuaidi</code></p></li><li><p>德邦：<code>debangwuliu</code></p></li><li><p>宅急送：<code>zhaijisong</code></p></li></ul><h4 id="淘宝商品接口" tabindex="-1">淘宝商品接口 <a class="header-anchor" href="#淘宝商品接口" aria-label="Permalink to &quot;淘宝商品接口&quot;">​</a></h4><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>http://suggest.taobao.com/sug?code=utf-8&amp;q=商品关键字&amp;callback=cb</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p><code>callback</code> 是回调函数设定</p>',65);function c(h,u,m,b,g,v){const a=r("AdUnitForInArticle");return i(),t("div",null,[d,s(a,{"data-ad-slot":4594918104}),l(),n])}const y=o(p,[["render",c]]);export{f as __pageData,y as default};
